g.ns107:text:
\begin{tikzpicture}
					[
						shorten >= 1pt,
						node distance=2.5cm,
						>=stealth,
						initial text=,
						bigarrow/.style={single arrow, fill=orange!50, anchor=base, align=center,text width=2.8cm},
						loss/.style={rectangle, very thick, fill=red!50, align=center, draw=red!70}
					]
					\tikzstyle{every state} = [circle, very thick, draw=orange!50, fill=orange!25]
					\node[state] (h0) {$\mathbold{h}_{t-1}$};
					\node[] (x0) [below of=h0] {$\mathbold{x}_{t-1}$};
					\node[state] (o0) [above of=h0] {$\mathbold{o}_{t-1}$};
					\node[] (start) [left of=o0] {};
					\node[loss] (u0) [above of=o0] {$\mathbold{u}_{t-1}$};
					\path[->, very thick]
					(start) edge[dotted] node [right, midway] {$\mathbold{W}$} (h0)
					(x0) edge node [left, midway] {$\mathbold{U}$} (h0)
					(x0) edge node [right, midway] {\textcolor{red}{$\downarrow\frac{\partial\mathbold{h}_{t-1}}{\partial\mathbold{x}_{t-1}}$}} (h0)
					(h0) edge node [left, midway] {$\mathbold{V}$} (o0)
					(h0) edge node [right, pos=0.1] {\textcolor{red}{$\downarrow \frac{\partial\mathbold{o}_{t-1}}{\partial\mathbold{h}_{t-1}}$}} (o0)
					(o0) edge node [right, midway] {\textcolor{red}{$\downarrow \frac{\partial\mathbold{u}_{t-1}}{\partial\mathbold{o}_{t-1}}$}} (u0)
					;
					\node[state] (h1) [right of=h0] {$\mathbold{h}_t$};
					\node[] (x1) [below of=h1] {$\mathbold{x}_t$};
					\node[state] (o1) [above of=h1] {$\mathbold{o}_t$};
					\node[loss] (u1) [above of=o1] {$\mathbold{u}_t$};
					\path[->, very thick]
					(o0) edge[dotted] node [above, midway, sloped] {\textcolor{red}{$\rightarrow \frac{\partial\mathbold{o}_{t-1}}{\partial\mathbold{h}_{t}}$}} (h1)
					(x1) edge node [right, midway] {\textcolor{red}{$\downarrow\frac{\partial\mathbold{h}_{t}}{\partial\mathbold{x}_{t}}$}} (h1)
					(h1) edge node [right, pos=0.1] {\textcolor{red}{$\downarrow \frac{\partial\mathbold{o}_{t}}{\partial\mathbold{h}_{t}}$}} (o1)
					(o1) edge node [right, midway] {\textcolor{red}{$\downarrow \frac{\partial\mathbold{u}_{t}}{\partial\mathbold{o}_{t}}$}} (u1)
					;
					\node[state] (h2) [right of=h1] {$\mathbold{h}_{t+1}$};
					\node[] (x2) [below of=h2] {$\mathbold{x}_{t+1}$};
					\node[state] (o2) [above of=h2] {$\mathbold{o}_{t+1}$};
					\node[] (end) [right of=h2] {};
					\node[loss] (u2) [above of=o2] {$\mathbold{u}_{t+1}$};
					\path[->, very thick]
					(o1) edge[dotted] node [above, midway, sloped] {\textcolor{red}{$\rightarrow \frac{\partial\mathbold{o}_t}{\partial\mathbold{h}_{t+1}}$}} (h2)
					(x2) edge node [right, midway] {\textcolor{red}{$\downarrow\frac{\partial\mathbold{h}_{t+1}}{\partial\mathbold{x}_{t+1}}$}} (h2)
					(h2) edge node [right, pos=0.1] {\textcolor{red}{$\downarrow \frac{\partial\mathbold{o}_{t+1}}{\partial\mathbold{h}_{t+1}}$}} (o2)
					(o2) edge node [right, midway] {\textcolor{red}{$\downarrow \frac{\partial\mathbold{u}_{t+1}}{\partial\mathbold{o}_{t+1}}$}} (u2)
					(o2) edge[dotted] node [right, midway] {} (end)
					;
					\node[loss] (l0) [above of=u0] {$\mathcal{L}_{t-1}$};
					\node[loss] (l1) [above of=u1] {$\mathcal{L}_{t}$};
					\node[loss] (l2) [above of=u2] {$\mathcal{L}_{t+1}$};
					\path[<->, very thick]
						(u0) edge[dotted] node [right, midway] (ul0) {\textcolor{red}{$\downarrow \frac{\partial\mathcal{L}_{t-1}}{\partial\mathbold{u}_{t-1}}$}} (l0)
						(u1) edge[dotted] node [right, midway] (ul1) {\textcolor{red}{$\downarrow \frac{\partial\mathcal{L}_{t}}{\partial\mathbold{u}_{t}}$}} (l1)
						(u2) edge[dotted] node [right, midway] (ul2) {\textcolor{red}{$\downarrow \frac{\partial\mathcal{L}_{t+1}}{\partial\mathbold{u}_{t+1}}$}} (l2)
						;
				\end{tikzpicture}
